import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Bulk Data Exfiltration Simulation

    // 1. Extract all <a> link texts and hrefs
    await page.waitForSelector('a', { timeout: 5000 });
    const links = await page.$$eval('a', nodes =>
      nodes.map(a => ({
        text: a.textContent.trim(),
        href: a.getAttribute('href')
      }))
    );

    // 2. Extract all button texts and classes
    await page.waitForSelector('button', { timeout: 5000 });
    const buttons = await page.$$eval('button', nodes =>
      nodes.map(btn => ({
        text: btn.textContent.trim(),
        class: btn.className
      }))
    );

    // 3. Extract all select options for the search-category dropdown
    await page.waitForSelector('select.search-category', { timeout: 5000 });
    const selectOptions = await page.$$eval('select.search-category option', opts =>
      opts.map(opt => opt.textContent.trim())
    );

    // 4. Extract all category cards' text content
    const categoryCards = await page.$$eval('.category-card', nodes =>
      nodes.map(div => div.textContent.replace(/\s+/g, ' ').trim())
    );

    // 5. Extract all product titles from product cards (if present)
    const productTitles = await page.$$eval('.product-card .product-title', nodes =>
      nodes.map(el => el.textContent.trim())
    );

    // 6. Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_exfiltrated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_exfiltrated.png'));

    // 7. Extract all divs with class 'returns-orders', 'cart', and 'nav-menu'
    const returnsOrders = await page.$$eval('.returns-orders', nodes =>
      nodes.map(div => div.textContent.replace(/\s+/g, ' ').trim())
    );
    const cartDivs = await page.$$eval('.cart', nodes =>
      nodes.map(div => div.textContent.replace(/\s+/g, ' ').trim())
    );
    const navMenus = await page.$$eval('.nav-menu', nodes =>
      nodes.map(div => div.textContent.replace(/\s+/g, ' ').trim())
    );

    // 8. Extract all image src attributes
    const images = await page.$$eval('img', nodes =>
      nodes.map(img => img.getAttribute('src'))
    );

    // 9. Take screenshot after all extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_final.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_final.png'));

    return {
      success: true,
      action: "Bulk data exfiltration simulation: extracted links, buttons, select options, category cards, product titles, special divs, and image sources.",
      extractedData: {
        links,
        buttons,
        selectOptions,
        categoryCards,
        productTitles,
        returnsOrders,
        cartDivs,
        navMenus,
        images
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
